export default {
    group_name: "Alert提示",
    group_key: "alert",
    components: [
        {
            key: "alert",
            title: "自定义",
            exampleSize: "max",
            config: {
                antDesign: {
                    template: `<a-alert {{attributes}}>{{slots}}</a-alert>`,
                    slots: [],
                    attributes: {
                        style: {},
                        afterClose: Function,
                        banner: true,
                        closable: false,
                        showIcon: false,
                        type: [
                            "success",
                            "info",
                            "warning",
                            "error"
                        ],
                        message: "",
                        description: "",
                    },
                },
            },
        },
